    "talcot-lake-national-wildlife-refuge-narrative-report-may-june-july-and-august-1946",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Talcot Lake NWR
    outlines Refuge accomplishments from May through August of 1946. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, furbearers, raptors, and fish- is
    also covered. The Refuge development and maintenance section discusses physical
    developments. Resource management is outlined; topics include grazing. The public
    relations section of the report describes Refuge visitors and fishing. N-R forms
    are attached.",nt"license_title": "License Not Specified",nt"extras":
